def anagrams(strs):
    anag = {}
    result = []
    for str in strs:
        s = ''.join(sorted(str))
        if (s in anag):
            anag[s].append(str)
        else:
            anag[s] = [str]
    for str in anag:
        if(len(anag[str])>1):
            result.extend(anag[str])
    return result
